ont-family:SimSun;font-size:14px;\">\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	&nbsp;&nbsp; <span> </span>\r\n</p>\r\n<p align=\"left\" style=\"text-align:left;text-indent:28pt;\">\r\n	<span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\">淘五季是重庆季吉氏家网络科技有限公司卓立打造的从厂家到实体终端的一站式垂直电商采购平台；公司于</span><span style=\"line-height:200%;font-size:14pt;\"><span>2014</span></span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\">年在香港九龙组注册成立，以日化产品为延伸，</span><span style=\"line-height:200%;font-size:14pt;\"><span>2014</span></span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\">年底正式进入电商市场，总部坐落于小香港重庆。</span></span>\r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span> <br />\r\n</span>\r\n</p>\r\n<p align=\"left\" style=\"text-align:left;text-indent:28pt;\">\r\n	<span style=\"line-height:200%;font-family:宋体;font-size:14pt;\"><span>淘五季已与阿里集团旗下的阿里云、支付宝、腾讯科技微信、微信支付、中国银联在线支付、上海某某科技、顺丰、四通一达、菜鸟物流、德邦远程物流、保洁、上海家化等企业达成战略合作伙伴。并得到重庆市政府、南岸区政府、重庆市商委、南岸区经济开发区的大力支支持，引进了长三角珠三角多家生产企业的入驻。</span></span>\r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span> <br />\r\n</span>\r\n</p>\r\n<p align=\"left\" style=\"text-align:left;text-indent:28pt;\">\r\n	<span style=\"line-height:200%;font-family:宋体;font-size:14pt;\"><span>淘五季以客户需求为工作导向，以去除中间多层价价为经营宗旨，着实盘活实体店的资金使用率，保证实体店的利润最大化。</span></span>\r\n</p>\r\n<p style=\"text-align:justify;margin-left:0in;\">\r\n	<span> <br />\r\n</span>\r\n</p>\r\n<p align=\"left\" style=\"text-align:left;text-indent:28pt;\">\r\n	<span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\">淘五季以大数据和云计算为依托，商品以厂家直供与入驻相结合，并自建仓储物流中心相的模式，实现优质、快捷、高效的服务体验。公司现有重庆物流配送中心仓储面积</span><span style=\"line-height:200%;font-size:14pt;\"><span>12000</span></span></span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\"><span>㎡，保证平台年</span></span><span><span style=\"line-height:200%;font-size:14pt;\"><span>10</span></span><span style=\"line-height:200%;font-family:宋体;font-size:14pt;\">亿