ft\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">重庆客户当日<span>18:00</span>前生成的订单，次日送达；当日<span>18:00</span>后生成的订单，隔日送达。</span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span><br />\r\n</span>异地客户当日<span>18:00</span>前生成的订单，<span>3</span>日内送达；当日<span>18:00</span>后生成的订单，<span>4</span>日内送达。<span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">注意事项： </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">若遇到特殊天气（如雨雪天气、地震等）、交通管制、停电、等其他因素，“急速达”将不能保证送货时效。 </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"></span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:9pt;\">2</span></b><b><span style=\"font-family:宋体;color:black;font-size:9pt;\">、配送覆盖范围</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">&nbsp;<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">以顾客在网页下单具体选择区域为准。</span></b> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"></span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">&nbsp;<span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;background:white;color:black;font-size:9pt;\">5</span></b><b><span style=\"font-family:宋体;background:white;color:black;font-size:9pt;\">、次日达配送覆盖范围</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"> </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">以顾客在网页下单具体选择区域为准。 </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:9pt;\">提醒注意：</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"> </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">、如遇交通管制、大雨雪、洪涝、冰灾、地震、节假日、停电等不可抗拒因素均不在“配送”服务范围内。</span> \r\n</p>\r\n<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n2</span>、需要依据当地仓库的库存情况为基础，同城出货承诺次日达，异地出货请您关注页面提示的配送时间。\r\n</p>\r\n<span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n3</span>、配送范围精确到区级，但只覆盖主城区，区级内偏远地区无法承诺次日配送，请您谅解。\r\n</p>\r\n<span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n4</span>、对于液体、粉末类（如乳液等化妆品，洗发水、玻璃水、清洁水等），磁性类商品（如音箱、磁动车），电池，压力类（足\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	球、篮球、排球等，摩丝等压力瓶），易燃类（油汀、打火机、火机油等）这些商品为国家明文规定的航空违禁品，必须通过\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	陆运方式运输，会有<span>2-3</span>天的时效延迟，请顾客在下单时注意，给您带来的不便尽请谅解。 <span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span></span>\r\n</p>','','','',0,1,1470001766,'',0,'http://','');

