/*Table structure for table `ecs_goods_stock` */

DROP TABLE IF EXISTS `ecs_goods_stock`;

CREATE TABLE `ecs_goods_stock` (
  `stock_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` int(10) unsigned NOT NULL,
  `goods_type` smallint(5) unsigned NOT NULL,
  `barcode` varchar(30) DEFAULT NULL,
  `cup` int(10) unsigned DEFAULT NULL,
  `cup_val` varchar(20) NOT NULL,
  `size` int(10) unsigned DEFAULT NULL,
  `size_val` varchar(20) CHARACTER SET ucs2 NOT NULL,
  `color` int(10) unsigned DEFAULT NULL,
  `color_val` varchar(20) NOT NULL,
  `stock_number` int(10) unsigned NOT NULL,
  PRIMARY KEY (`stock_id`)
) ENGINE=MyISAM AUTO_INCREMENT=10031 DEFAULT CHARSET=utf8;

